// src/App.js
import React from "react";
import SideNav from "./components/sidenav";

function App() {
  return (
    <div class="flex bg-gray-200">
      <SideNav />
      <div class="flex-1 text-gray-700 text-center bg-gray-400 px-4 py-2 m-2">
        Some Page Content
      </div>
    </div>
  );
}

export default App;
